import React from 'react'

function Liftar({ barnLift, expr, fjl, mellanLift, liikavaara, barnReady, exprReady, fjlReady, mellanReady, liikavaaraReady }) {
  // Lifts open/ready/closed status dots
  const statusDotsOpen = <span className="dots"><span className="dotOpen"></span><span className="dot"></span><span className="dot"></span></span>;
  const statusDotsReady = <span className="dots"><span className="dot"></span><span className="dotReady"></span><span className="dot"></span></span>;
  const statusDotsClosed = <span className="dots"><span className="dot"></span><span className="dot"></span><span className="dotClosed"></span></span>;

  o
  
  // Lifts open/ready/closed text
  const liftOpen = <span className="open">Öppen</span>;
  const liftReady = <span className="ready">Startklar</span>
  const liftClosed = <span className="closed">Stängd</span>;

  const bb = barnLift === "1" ? liftOpen 
            : barnReady === "1" ? liftReady
            : liftClosed;
  const ex = expr === "1" ? liftOpen 
            : exprReady === "1" ? liftReady
            : liftClosed;
  const fj = fjl === "1" ? liftOpen 
            : fjlReady === "1" ? liftReady
            : liftClosed;
  const ml = mellanLift === "1" ? liftOpen 
            : mellanReady === "1" ? liftReady
            : liftClosed;
  const sl = liikavaara === "1" ? liftOpen 
            : liikavaaraReady === "1" ? liftReady
            : liftClosed;



  return (
    <div className="status-box">
      <h3>Liftar</h3>
      <p className="value-box">Transportbandet {bb}</p>
      <p className="value-box">Dundret Express {ex}</p>
      <p className="value-box">Fjälliften {fj} </p>
      <p className="value-box">Mellanliften {ml} </p>
      <p className="value-box">Liikavaaraliften {sl} </p>
    </div>
  )
}

export default Liftar
